import React, { useState, useEffect } from "react";
import { useParams } from 'react-router-dom';

const ProfileCompoment = () => {
  const [user, setUser] = useState(null);
  const { Id } = useParams(); 

  useEffect(() => {
    const fetchUserInfo = async () => {
      try {
        const response = await fetch('http://localhost:3002/users/user-info', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify({ userid: Id })
        });

        if (response.ok) {
          const userInfo = await response.json();
          setUser(userInfo);
        } else {
          console.error('Failed to fetch user information');
        }
      } catch (error) {
        console.error('Error fetching user information:', error);
      }
    };

    if (Id) {
      fetchUserInfo();
    }
  }, [Id]); 

  return (<div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#f0f4f8' }}>
    <div style={{ backgroundColor: '#fff', padding: '30px', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', maxWidth: '500px', width: '100%' }}>
      <h1 style={{ textAlign: 'center', color: '#333', marginBottom: '20px' }}>Profile Page</h1>
      {user && (
        <div>
          <div style={{ marginBottom: '20px', textAlign: 'center' }}>
            <label style={{ fontSize: '18px', color: '#555' }}>
              Welcome, <strong style={{ color: '#007bff' }}>{user[1]}</strong>!
            </label>
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              User ID:
            </label>
            <input type="text" value={user[0]} readOnly style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc', backgroundColor: '#e9ecef' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Username:
            </label>
            <input type="text" value={user[1]} readOnly style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc', backgroundColor: '#e9ecef' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Password:
            </label>
            <input type="password" value={user[2]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Email:
            </label>
            <input type="text" value={user[3]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Full Name:
            </label>
            <input type="text" value={user[4]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Phone Number:
            </label>
            <input type="tel" value={user[5]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Address:
            </label>
            <textarea value={user[6]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }}></textarea>
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Registration Date:
            </label>
            <input type="text" value={user[7]} readOnly style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc', backgroundColor: '#e9ecef' }} />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', fontSize: '16px', color: '#333', marginBottom: '8px' }}>
              Role:
            </label>
            <input type="text" value={user[8]} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ccc' }} />
          </div>
        </div>
      )}
    </div>
  </div>

  );
};

export default ProfileCompoment;
